      SELECT DISTINCT + - COUNT ( * ) + - + COUNT ( * ) AS col0 FROM tab1 WHERE NOT + + 87 * - + 97 * col2 + - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q509.out
    data: |
      0
